/* eslint-disable */

const input = `



`;

const grid = [
  [ 0, 0, 1, 0, 0 ],
  [ 0, 2, 3, 4, 0 ],
  [ 5, 6, 7, 8, 9 ],
  [ 0, 'A', 'B', 'C', 0 ],
  [ 0, 0, 'D', 0, 0 ],
];

const rows = input.split('\n');

const dirs = {
  U: {
    key: 0,
    dir: -1,
  },
  D: {
    key: 0,
    dir: 1,
  },
  L: {
    key: 1,
    dir: -1,
  },
  R: {
    key: 1,
    dir: 1,
  },
};

const presses = [];

for (let i=0, l=rows.length, position = [3, 0]; i<l; i++) {
  let row = rows[i].split('');
  let move;
  while ((move = row.shift())) {
    let {
      key,
      dir,
    } = dirs[move];

    const start = [].concat(position);
    console.info('start, key, dir', start, key, dir);
    position[key] += dir;

    const button = grid[position[0]] && grid[position[0]][position[1]];
    console.info('button', button);
    if (!button) {
      console.info('go back');
      position[0] = start[0];
      position[1] = start[1];
    }
    console.info('position', position);
  }
  const press = grid[position[0]][position[1]];
  presses.push(press);
}

console.info('presses', presses.join(''));
